            var attr = points[j].split("#");
            var pt = new google.maps.LatLng(attr[0], attr[1]);
            var title = attr[2];
            var imgIdx = attr[3];

            //alert(points[j]);
            var marker = new google.maps.Marker({
              position: pt,
              map: map,
              title: " " + title,
              //icon: img[imgIdx]
              icon: {
                  url: img[imgIdx],
                  anchor: new google.maps.Point(8, 8)
              },
              clickable: true,
              zIndex: j
            });

            var info = "<p><b>" + title + "</b>";

            }
            info += "</p>";
            setInfoWindow(map, marker, info);
        }

    }

function setInfoWindow(map, marker, infotext) {
   var infowindow = new google.maps.InfoWindow({
       content: "<div>" + infotext + "</div>"
   });

   google.maps.event.addListener(marker, 'click', function(){
        infowindow.setZIndex(0);
        infowindow.open(map,marker);
   });
}

function hsvToRgb(h, s, v){
    var r, g, b;

    var i = Math.floor(h * 6);
    var f = h * 6 - i;
    var p = v * (1 - s);
    var q = v * (1 - f * s);
    var t = v * (1 - (1 - f) * s);

    switch(i % 6){
        case 0: r = v, g = t, b = p; break;
        case 1: r = q, g = v, b = p; break;
        case 2: r = p, g = v, b = t; break;
        case 3: r = p, g = q, b = v; break;
        case 4: r = t, g = p, b = v; break;
        case 5: r = v, g = p, b = q; break;
    }

    r = parseInt(r * 255);
    g = parseInt(g * 255);
    b = parseInt(b * 255);
    return "#" + componentToHex(r) + componentToHex(g) + componentToHex(b);
}

function componentToHex(c) {
    var hex = c.toString(16);
    return hex.length == 1 ? "0" + hex : hex;
}

function getURLParameter(name) {
    return decodeURI(
        (RegExp(name + '=' + '(.+?)(&|$)').exec(location.search)||[,null])[1]
    );
}

google.maps.event.addDomListener(window, 'load', initialize);
